import React, { useState } from 'react';
import LineGraphRarity from "../components/LineGraphRarity";
import LineGraphWeapon from "../components/LineGraphWeapon";
import LineGraphObtainVia from "../components/LineGraphObtainVia";
import LineGraphVision from "../components/LineGraphVision";
import LineGraphGender from "../components/LineGraphGender";

function TimelinePage() {
  const [selectedProperty, setSelectedProperty] = useState('');

  const handlePropertyChange = (event) => {
    setSelectedProperty(event.target.value);
  };

  return (
    <div className="page" style={{ backgroundColor: '#192536', color: 'white', position: 'relative' }}>
      <h6 style={{ textAlign: 'center', marginBottom: '10px' }}>Timeline</h6>
      <div style={{ marginBottom: '20px' }}>
        <label htmlFor="property-select">Select Property:</label>
        <select id="property-select" value={selectedProperty} onChange={handlePropertyChange}>
          <option value="">Select a property</option>
          <option value="rarity">Rarity</option>
          <option value="weapon">Weapon</option>
          <option value="obtainVia">Obtain Via</option>
          <option value="vision">Vision</option>
          <option value="gender">Gender</option>
        </select>
      </div>
      {selectedProperty === 'rarity' && <LineGraphRarity />}
      {selectedProperty === 'weapon' && <LineGraphWeapon />}
      {selectedProperty === 'obtainVia' && <LineGraphObtainVia />}
      {selectedProperty === 'vision' && <LineGraphVision />}
      {selectedProperty === 'gender' && <LineGraphGender />}
    </div>
  );
}

export default TimelinePage;
